function RestaurantEntity(props) {
    const handleClick = () => {
        props.onClickHandler(props.data.location);
    };
    // Add basic styling for each restaurant entry
    const entryStyle = {
        display: "inline-block",
        padding: "10px",
        margin: "5px",
        border: "1px solid gray",
        borderRadius: "5px",
        cursor: "pointer",
    };

    return (
        <div style={{entryStyle,
            backgroundColor: isSelected ? '#e3f2fd' : 'white',
        }} onClick={handleClick}>
            {props.data.name}
        </div>
    );
}

function RestaurantList({ list, selectedLocations, onClickHandler }) {
    return (
        <div style={{ display: 'grid', gap: '8px' }}>
            {list.map(entry => (
                <RestaurantEntity
                    key={entry.name}
                    data={entry}
                    isSelected={selectedLocations.some(l =>
                        l.lat === entry.location.lat &&
                        l.lng === entry.location.lng
                    )}
                    onClickHandler={onClickHandler}
                />
            ))}
        </div>
    );
}
export default RestaurantList;
